webpackJsonp([0xa0ba6a996dae],{531:function(A,I){A.exports={data:{pages:{internal:{content:'{"id":4,"title":"About Child Sensitivity","slug":"about/child-sensitivity","template":"about.jsx","category":"about"}'},childPagesContent:{internal:{content:'{"0":{"type":"section","content":{"0":{"text":"child sensitivity in poverty alleviation programmes","type":"header"},"1":{"text":"<p>Child-sensitive policies, programmes and interventions explicitly aim to maximize the benefits for children and minimize any harm. They do so by:&nbsp;</p>\\n<ul>\\n<li>Assessing and monitoring both positive and negative impacts for children, disaggregated by the age, gender and vulnerabilities of the child.&nbsp;</li>\\n<li>Listening to and taking account of the voices and views of children in their planning, design, implementation and review.&nbsp;</li>\\n</ul>\\n<p>Including child-sensitivity in poverty alleviation (PA) programmes is a practical approach that ensures PA programmes explicitly maximize benefits and minimize harm to children.&nbsp;&nbsp;</p>\\n","type":"paragraph"}}},"1":{"type":"section","content":{"0":{"text":"Essential elements of a child-sensitive approach","type":"header"},"1":{"text":"<p>Essential elements of a child-sensitive approach to PA programming:</p>\\n<ul>\\n<li>Assessment of the positive and negative impacts of PA programmes on children.</li>\\n<li>Listen to and take account of children, their caregivers and the communities throughout the programme cycle.&nbsp;</li>\\n</ul>\\n<p>Additional principles of a child-sensitive approach to PA programming:</p>\\n<ul>\\n<li>Flexible and adaptive programme design and implementation to ensure “do no harm” to children.&nbsp;</li>\\n<li>Accountability of project teams to children and caregivers.&nbsp;</li>\\n<li>Take a rights-based approach.&nbsp;</li>\\n<li>Aim for gender transformative programming&nbsp;</li>\\n<li>Collaborate closely with other sectors (i.e. using an integrated approach) to address all root causes of children’s deprivations (including and beyond poverty).&nbsp;</li>\\n<li>Use innovative and evidence-based approaches to enhance PA interventions (e.g. tackling behavioural barriers to improve children’s wellbeing by incorporating a Social Behaviour Change Communication (SBCC) component).</li>\\n</ul>\\n","type":"paragraph"}}},"2":{"type":"section","content":{"0":{"type":"image","source":"data:image/jpeg;base64,","caption":"Introduction to child sensitivity in poverty alleviation programmes"}}}}'
}}}},pathContext:{slug:"about/child-sensitivity"}}}});
